import React from 'react';

function UpdateInventory() {
  return (
    <div>
      <h2>Update Inventory</h2>
      <ul>
        <li>Adjust Stock Levels</li>
        <li>Update Last Updated Date</li>
      </ul>
    </div>
  );
}

export default UpdateInventory;
